import React from 'react';
import { Card } from 'antd';
import 'antd/dist/antd.css';

const contentList = {
    line1: 'Growth Condition',
    line2: 'Overall Score',
    line3: 'Action To Do'
}

class FrontCard extends React.Component {
    render() {
        return (
            <Card style={{ width: 300 }}>
                <p>Growth Condition</p>
                <p>Overall Score</p>
                <p>Action To Do</p>
            </Card>
        );
    }
}

export default FrontCard;
